import React, { useState, useEffect, useCallback } from 'react';
import {
  ReactFlow, MiniMap, Controls, Background, useNodesState, useEdgesState,
  addEdge, Handle, Position, MarkerType,
} from 'reactflow';
import 'reactflow/dist/style.css';

const PhaseNode = ({ data, selected }) => {
  const isStartNode = data.type === 'start';
  const isEndNode = data.type === 'end';

  return (
    <>
      {!isStartNode && <Handle type="target" position={Position.Top} className="!w-2 !h-2 !bg-gray-400" />}

      <div className={`w-64 bg-gray-900 border-2 rounded-lg p-4 ${selected ? 'border-blue-500 shadow-lg' : 'border-gray-700'} ${isStartNode ? '!border-green-500' : ''} ${isEndNode ? '!border-blue-500' : ''}`}>
        <div className="flex items-center gap-3 mb-2">
          <span className="text-xl">{data.emoji}</span>
          <span className="font-semibold">{data.label}</span>
        </div>
        {data.duration && <div className="text-xs text-gray-400 mb-2">{data.duration}</div>}
        {data.description && (
          <p className="text-sm text-gray-300 border-t border-gray-700 pt-2 mt-2">{data.description}</p>
        )}
        {data.skills && data.skills.length > 0 && (
          <div className="flex flex-wrap gap-2 pt-2 mt-2 border-t border-gray-700">
            {data.skills.map((skill, idx) => (
              <span key={idx} className="text-xs bg-gray-700 px-2 py-1 rounded-full">{skill}</span>
            ))}
          </div>
        )}
      </div>

      {!isEndNode && <Handle type="source" position={Position.Bottom} className="!w-2 !h-2 !bg-gray-400" />}
    </>
  );
};

const nodeTypes = { phaseNode: PhaseNode };

const CareerRoadmapFlow = ({ learningPath }) => {
  const [nodes, setNodes, onNodesChange] = useNodesState([]);
  const [edges, setEdges, onEdgesChange] = useEdgesState([]);
  const [selectedNode, setSelectedNode] = useState(null);

  const nodeSpacing = 200; // Increased spacing

  const onConnect = useCallback((params) => setEdges((eds) => addEdge(params, eds)), [setEdges]);

  const onNodeClick = useCallback((event, node) => {
    setSelectedNode(node);
    console.log('Selected Node:', node);
  }, []);

  useEffect(() => {
    if (!learningPath || !learningPath.learning_phases) {
        setNodes([]);
        setEdges([]);
        return;
    }

    const phaseNodes = [];
    const phaseEdges = [];
    const phases = learningPath.learning_phases;

    phaseNodes.push({
      id: 'start', type: 'phaseNode', position: { x: 50, y: 50 },
      data: { label: 'Current Role', emoji: '👨‍💻', type: 'start' },
    });

    phases.forEach((phase, index) => {
      phaseNodes.push({
        id: `phase-${index}`, type: 'phaseNode',
        position: { x: 50, y: 150 + (index * nodeSpacing) },
        data: {
          label: phase.phase || `Phase ${index + 1}`,
          duration: phase.duration,
          skills: phase.skills || [],
          description: phase.description,
          emoji: ['📚', '🎓', '🏆', '⭐', '🚀', '💡'][index % 6],
        },
      });
      phaseEdges.push({
        id: `edge-${index}`, source: index === 0 ? 'start' : `phase-${index - 1}`, target: `phase-${index}`,
      });
    });

    phaseNodes.push({
      id: 'end', type: 'phaseNode',
      position: { x: 50, y: 150 + (phases.length * nodeSpacing) },
      data: { label: 'Target Role', emoji: '🎯', type: 'end' },
    });

    phaseEdges.push({
      id: `edge-final`, source: phases.length > 0 ? `phase-${phases.length - 1}` : 'start', target: 'end',
      style: { stroke: '#10b981', strokeWidth: 3 },
      markerEnd: { type: MarkerType.ArrowClosed, width: 25, height: 25, color: '#10b981' },
    });

    setNodes(phaseNodes);
    setEdges(phaseEdges);
  }, [learningPath, setNodes, setEdges]);

  return (
    <div className="w-full h-full">
      <ReactFlow
        nodes={nodes}
        edges={edges}
        onNodesChange={onNodesChange}
        onEdgesChange={onEdgesChange}
        onConnect={onConnect}
        onNodeClick={onNodeClick}
        nodeTypes={nodeTypes}
        defaultEdgeOptions={{
          animated: true,
          style: { stroke: '#4b5563' },
          markerEnd: { type: MarkerType.ArrowClosed, color: '#4b5563' },
        }}
        fitView
      >
        <Controls />
        <MiniMap nodeColor="#2dd4bf" nodeStrokeWidth={3} />
        <Background variant="dots" gap={12} size={1} />
      </ReactFlow>

      {selectedNode && (
        <div className="absolute top-4 right-4 bg-gray-900 border border-gray-700 rounded-lg p-4 w-80 shadow-lg">
          <button onClick={() => setSelectedNode(null)} className="absolute top-2 right-2 text-gray-400 hover:text-white">&times;</button>
          <h3 className="text-lg font-semibold flex items-center gap-2">{selectedNode.data.emoji} {selectedNode.data.label}</h3>
          <p className="text-sm text-gray-400 mb-4">{selectedNode.data.duration}</p>

          <h4 className="font-semibold text-gray-200">Description</h4>
          <p className="text-sm text-gray-300 mb-4">{selectedNode.data.description || 'No details provided.'}</p>

          <h4 className="font-semibold text-gray-200">Skills to Develop</h4>
          <div className="flex flex-wrap gap-2 mt-2">
            {selectedNode.data.skills?.map((skill, i) => <span key={i} className="text-xs bg-gray-700 px-2 py-1 rounded-full">{skill}</span>)}
          </div>
        </div>
      )}
    </div>
  );
};

export default CareerRoadmapFlow;
